import React, { useRef, useEffect, useState } from 'react';
import { motion, useScroll, useTransform } from 'framer-motion';
import { Link } from 'react-router-dom';
import { homeData } from '../data';
import TestimonialSlideshow from '../components/TestimonialSlideshow';
import ImageCarousel from '../components/ImageCarousel'; // <-- IMPORTED
import '../styles/Home.css';

const Home = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  const heroRef = useRef(null);
  // const galleryRef = useRef(null); // No longer needed
  const servicesSectionRef = useRef(null);
  const [isServicesSectionInView, setIsServicesSectionInView] = useState(false);

  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            setIsServicesSectionInView(true);
            observer.unobserve(entry.target);
          }
        });
      },
      { threshold: 0.3 }
    );

    if (servicesSectionRef.current) {
      observer.observe(servicesSectionRef.current);
    }

    return () => {
      if (servicesSectionRef.current) {
        // eslint-disable-next-line react-hooks/exhaustive-deps
        observer.unobserve(servicesSectionRef.current);
      }
    };
  }, []);

  const { scrollYProgress: heroScrollYProgress } = useScroll({
    target: heroRef,
    offset: ['start end', 'end start'],
  });
  const heroBgY = useTransform(heroScrollYProgress, [0, 1], ['-20%', '20%']);

  // Parallax for Gallery section is removed as we are replacing that component.

  // A curated list of high-quality images for the new carousel
  const galleryImages = [
    'https://images.unsplash.com/photo-1542744095-291d1f67b221?ixlib=rb-4.0.3&q=85&fm=jpg&crop=entropy&cs=srgb&w=800',
    'https://images.unsplash.com/photo-1522202176988-66273c2fd55f?ixlib=rb-4.0.3&q=85&fm=jpg&crop=entropy&cs=srgb&w=800',
    'https://images.unsplash.com/photo-1556761175-5973dc0f32e7?ixlib=rb-4.0.3&q=85&fm=jpg&crop=entropy&cs=srgb&w=800',
    'https://images.unsplash.com/photo-1573496799652-408c2ac9fe98?ixlib=rb-4.0.3&q=85&fm=jpg&crop=entropy&cs=srgb&w=800',
    'https://images.unsplash.com/photo-1519389950473-47ba0277781c?ixlib=rb-4.0.3&q=85&fm=jpg&crop=entropy&cs=srgb&w=800',
    'https://images.unsplash.com/photo-1552664730-d307ca884978?ixlib=rb-4.0.3&q=85&fm=jpg&crop=entropy&cs=srgb&w=800',
    'https://images.unsplash.com/photo-1600880292203-757bb62b4baf?ixlib=rb-4.0.3&q=85&fm=jpg&crop=entropy&cs=srgb&w=800',
    'https://images.unsplash.com/photo-1557804506-669a67965ba0?ixlib=rb-4.0.3&q=85&fm=jpg&crop=entropy&cs=srgb&w=800'
  ];

  return (
    <div className="home-page-clone">
      {/* Services Image Column (Moved to top) */}
      <div 
        className="services-image-column" 
        style={{
          backgroundImage: `url(${homeData.services.image})`,
        }}
      />

      {/* Section 1: Services Text */}
      <section 
        ref={servicesSectionRef} 
        className={`services-section ${isServicesSectionInView ? 'in-view' : ''}`}
      >
        <div className="services-text-column">
          <div className="services-content">
            <h2>{homeData.services.title}</h2>
            <div className="services-icon">
              <svg viewBox="0 0 100 60" className="floral-ornament">
                <g fill="none" stroke="#b8a082" strokeWidth="1.5">
                  <path d="M20 30 Q 30 20, 40 30 Q 50 40, 60 30 Q 70 20, 80 30" />
                  <circle cx="30" cy="25" r="3" fill="#b8a082" opacity="0.6" />
                  <circle cx="50" cy="35" r="2.5" fill="#b8a082" opacity="0.4" />
                  <circle cx="70" cy="25" r="2" fill="#b8a082" opacity="0.5" />
                  <path d="M25 30 L35 30 M45 30 L55 30 M65 30 L75 30" strokeWidth="0.8" opacity="0.3" />
                </g>
              </svg>
            </div>
            <p>{homeData.services.subtitle}</p>
            <Link to={homeData.services.buttonLink} className="discover-button">{homeData.services.buttonText}</Link>
          </div>
        </div>
      </section>

      {/* Section 2: Hero (Unchanged) */}
      <section ref={heroRef} className="hero-section">
        <motion.div 
          className="parallax-background" 
          style={{
            y: heroBgY, 
            backgroundImage: `url(${homeData.hero.image})` 
          }} 
        />
        <div className="hero-pattern-overlay"></div>
        <div className="hero-content">
          <div className="hero-text-content">
            <h1 className="hero-main-title">{homeData.hero.titleLines[0]}</h1>
            <h2 className="hero-subtitle">{homeData.hero.titleLines[1]}</h2>
            <h3 className="hero-accent">{homeData.hero.titleLines[2]}</h3>
          </div>
          <a href="#testimonials" className="hero-scroll-indicator" aria-label="Scroll down">
            <div className="scroll-dot"></div>
          </a>
        </div>
      </section>

      {/* Anchor for scrolling (Unchanged) */}
      <div id="testimonials" style={{position: 'relative', top: '-80px'}}></div>

      {/* Section 3: Testimonials (Unchanged) */}
      <section className="testimonials-section">
        <TestimonialSlideshow testimonials={homeData.testimonials} />
      </section>

      {/* Section 4: NEW Interactive Gallery Carousel */}
      <section className="gallery-carousel-section">
          <div className="gallery-carousel-header">
              <h2>{homeData.gallery.title}</h2>
              <p>{homeData.gallery.subtitle}</p>
          </div>
          <ImageCarousel images={galleryImages} />
          <div className="gallery-carousel-cta">
            <Link to={homeData.gallery.buttonLink} className="discover-button-dark">{homeData.gallery.buttonText}</Link>
          </div>
      </section>

    </div>
  );
};

export default Home;
